const execFileAsync = promisify(execFile);

const git = async (
	args: string[],
	options?: { cwd?: string; timeoutMs?: number },
) => {
	await execFileAsync(
		"git",
		[
			"-c",
			"core.hooksPath=/dev/null",
			"-c",
			"submodule.recurse=false",
			...args,
		],
		{
			cwd: options?.cwd,
			timeout: options?.timeoutMs,
			maxBuffer: 1024 * 1024,
			env: {
				...process.env,
				GIT_TERMINAL_PROMPT: "0",
			},
		},
	);
};

