    sources[result.id] = {
      repo: result.repo,
      ref: result.ref,
      resolvedCommit: result.resolvedCommit,
      bytes: result.bytes ?? prior?.bytes ?? 0,
      fileCount: result.fileCount ?? prior?.fileCount ?? 0,
      manifestSha256:
        result.manifestSha256 ?? prior?.manifestSha256 ?? result.resolvedCommit,
      updatedAt: now,
    };
  }
  return {
    version: 1 as const,
    generatedAt: now,
    toolVersion,
    sources,
