export const CLI_NAME = "docs-cache";

const HELP_TEXT = `
Usage: ${CLI_NAME} <command> [options]

Commands:
  add     Add sources to the config (supports github:org/repo#ref)
  sync    Synchronize cache with config
  status  Show cache status
